import React from 'react';
import Country from '../images/Country.png'

const Home = () => {
  return (
      <div className="max-w-sm rounded-xl overflow-hidden w-72 ml-11 mt-7">
        <img className="w-72" src={Country} alt="Sunset in the mountains" />
        <div className=" py-4">
          <div className="font-semibold">place</div>
          <p className="text-gray-500 text-sm">
          Name
          </p>
          <h1 className='text-gray-500'>Date</h1>
          <h1 className='font-semibold'>Price</h1>
        </div>
      </div>
  );
};

export default Home;
